import styled from "styled-components"

const Header = styled.div`
    height:70px;
    font-weight:600;
    color:white;
    z-index:100;
    font-size:1.2em;
    width:100%;
    background-color:#448487;
    position:fixed;
    display:flex;
    align-items:center;
    justify-content:space-between;
    .right{
        display:flex;
        flex:1;
    }
    .right{
        display:flex;
        flex:1;
    }

`
export default Header
